import React from 'react';
import './style.scss';
import ProfileImage from '../../assets/image/profile.svg';
import { Container, Row,Col,Image,Dropdown,DropdownButton } from 'react-bootstrap';


export class Profile extends React.Component{
    constructor(props) {
      super(props);
      this.state = {
        Name:"shubhamm kumawat",
        Email:"Xyz@mail.com",
        Phone:"+91 xxxxx xxxxx",
        Gendeer:"male",
        Address:"no, xyz at abc colony in indore MP"
        
      };
    }
    render() {
        return (
            <Container>        
                <Row>
                    <Col>
                    <h1>User Profile</h1>

                    </Col>
                </Row>    
            <Image src={ProfileImage} className="image" alt="Logo"/>
            <div>Name :<span>{this.state.Name}</span></div>
            <div>Email :<span>{this.state.Email}</span></div>
            <div>Phone No :<span>{this.state.Phone}</span></div>
            <div>Address :<span>{this.state.Address}</span></div>
            <button>edit profile</button>
            </Container>

              );
    }
  }
